import React from "react";
import "./signin.style.css"

const Signin = () => {
    return (
      <div className={"cover"}>
          <h1>Login</h1>
          <input type={"text"} placeholder={"Email Address"}/>
          <input type={"password"} placeholder={"Password"}/>

      </div>
    )
};
export default Signin;
